import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Dashboard = () => {
    const [users, setUsers] = useState([]);

  useEffect(()=>{
    const fetchUsers = () =>{
      try {
        const response = axios.get("http://localhost:3001/admin/users");
        setUsers(response.data);
        console.log("response data of users: ", response.data); 
      } catch (error) {
        console.error('Error fetching users', error);

      }
    } 
  }, [])

    return(
      <>
        <div> 
            <h1> Welcom Admin! </h1>
            <div>
              <h2> Users </h2>

              <ul>
               {users && users.map((user, index)=>(
                <li key={index}>
                  {user.username} 
                </li>
               ))} 

              </ul>

            </div>
        </div>
      </>
    )
}

export default Dashboard;
